module.exports = {
  env: {
    node: true,
    browser: true,
    es2021: true,
  },
  globals: {
    describe: true,
    it: true,
    expect: true,
    beforeEach: true,
  },
  extends: [
    'eslint-config-tencent',
    'eslint-config-tencent/ts',
    'plugin:vue/vue3-essential',
    './prettier.cjs',
  ],
  parser: 'vue-eslint-parser',
  parserOptions: {
    ecmaVersion: 12,
    parser: '@typescript-eslint/parser',
    extraFileExtensions: ['.vue'],
    sourceType: 'module',
  },
  plugins: [
    'vue',
    '@typescript-eslint',
    'simple-import-sort'
  ],
  ignorePatterns: ['.eslintrc.cjs'],
  rules: {
    'vue/no-mutating-props': 'off',
    'vue/multi-word-component-names': 'off',
    'no-param-reassign': 'off',
    '@typescript-eslint/naming-convention': 'off',
    '@typescript-eslint/no-require-imports': 'off',
    "@typescript-eslint/no-misused-promises": [
      "error",
      {
        "checksVoidReturn": false
      }
    ],
    'simple-import-sort/imports': [
      "error", {
        groups: [
          ['./polyfills'],
          // Node.js builtins. You could also generate this regex if you use a `.js` config.
          // For example: `^(${require("module").builtinModules.join("|")})(/|$)`
          [
            "^(assert|buffer|child_process|cluster|console|constants|crypto|dgram|dns|domain|events|fs|http|https|module|net|os|path|punycode|querystring|readline|repl|stream|string_decoder|sys|timers|tls|tty|url|util|vm|zlib|freelist|v8|process|async_hooks|http2|perf_hooks)(/.*|$)",
          ],
          ["^(node)(:.*|$)"],
          // Packages. `react|vue` related packages come first.
          ["^(react|vue|vite)", "^@?\\w"],
          ["^(@tmagic)(/.*|$)"],
          // Internal packages.
          ["^(@|@editor|@data-source)(/.*|$)"],
          // Side effect imports.
          ["^\\u0000"],
          // Parent imports. Put `..` last.
          ["^\\.\\.(?!/?$)", "^\\.\\./?$"],
          // Other relative imports. Put same-folder imports and `.` last.
          ["^\\./(?=.*/)(?!/?$)", "^\\.(?!/?$)", "^\\./?$"],
          // Style imports.
          ["^.+\\.s?css$"],
        ],
      }
    ]
  },
};

import { existsSync, readdirSync, readFileSync, writeFileSync } from 'node:fs';
import path from 'node:path';
import { fileURLToPath } from 'node:url';

import alias from '@rollup/plugin-alias';
import dts from 'rollup-plugin-dts';

if (!existsSync('temp')) {
  console.warn(
    'no temp dts files found. run `tsc -p tsconfig.build-browser.json && vue-tsc --declaration --emitDeclarationOnly --project tsconfig.build-vue.json` first.',
  );
  process.exit(1);
}

removeScss('temp/editor/src/index.d.ts');
removeScss('temp/form/src/index.d.ts');
removeScss('temp/design/src/index.d.ts');
removeScss('temp/table/src/index.d.ts');

const packages = readdirSync('temp');
const targets = process.env.TARGETS ? process.env.TARGETS.split(',') : null;
const targetPackages = targets ? packages.filter((pkg) => targets.includes(pkg)) : packages;

const __dirname = path.dirname(fileURLToPath(import.meta.url));

export default targetPackages.map((pkg) => ({
  input: `./temp/${pkg}/src/index.d.ts`,
  output: {
    file: `packages/${pkg}/types/index.d.ts`,
    format: 'es',
  },
  plugins: [
    alias({
      entries: [
        { find: /^@form/, replacement: path.join(__dirname, `./temp/form/src`) },
        { find: /^@editor/, replacement: path.join(__dirname, `./temp/editor/src`) },
        { find: /^@data-source/, replacement: path.join(__dirname, `./temp/data-source/src`) },
      ],
    }),
    dts(),
  ],
  onwarn(warning, warn) {
    // during dts rollup, everything is externalized by default
    if (warning.code === 'UNRESOLVED_IMPORT' && !warning.exporter?.startsWith('.')) {
      return;
    }
    warn(warning);
  },
}));

function removeScss(path) {
  writeFileSync(path, readFileSync(path).toString().replace(`import './theme/index.scss';`, ''));
}

declare module '*.vue' {
  import { DefineComponent } from 'vue';

  const component: DefineComponent<{}, {}, any>;
  export default component;
}

{
  "extends": "./tsconfig.json",
  "compilerOptions": {
    "declaration": true,
    "emitDeclarationOnly": true,
    "stripInternal": true
  },
  "include": [
    "packages/design/src",
    "packages/editor/src",
    "packages/form/src",
    "packages/table/src",
    "packages/tdesign-vue-next-adapter/src",
  ]
}

{
  "extends": "./tsconfig.json",
  "include": [
    "packages/design/src",
    "packages/editor/src",
    "packages/form/src",
    "packages/table/src",
    "packages/tdesign-vue-next-adapter/src",
  ]
}

import { resolve } from 'path';

import { defineConfig } from 'vitest/config';
import Vue from '@vitejs/plugin-vue';

const r = (p: string) => resolve(__dirname, p);

export default defineConfig({
  plugins: [Vue()],

  test: {
    include: ['./packages/*/tests/**', './runtime/*/tests/**'],
    environment: 'jsdom',
    environmentMatchGlobs: [['packages/cli/**', 'node']],
    coverage: {
      exclude: [
        './runtime/**',
        './playground/**',
        './docs/**',
        './packages/*/types/**',
        './packages/*/tests/**',
        './packages/cli/lib/**',
        './packages/ui/**',
        './packages/ui-react/**',
        './packages/design/**',
        './packages/element-plus-adapter/**',
        './packages/tdesign-vue-next-adapter/**',
      ],
      extension: ['.ts', '.vue'],
    },
  },

  resolve: {
    alias: {
      '@editor': r('./packages/editor/src'),
      '@form': r('./packages/form/src'),
      '@data-source': r('./packages/data-source/src'),
    },
  },
});
